import React, { useState, useEffect } from "react";
import Axios from "../../node_modules/axios";
// import { useHistory } from "react-router-dom"
//import "../components/TestIndex.css";
import "../../node_modules/bootstrap/dist/css/bootstrap.min.css";

function Indexinter() {
  var inteobj = []
  const [axlist, setstate] = useState(inteobj)

  useEffect(() => {
    Axios.get("http://interviewapi.stgbuild.com/getQuizData").then((response) => {
    const inlist = response.data.tests
    setstate(inlist)
  })
  },[])

  console.log(axlist)

  const listItems = axlist.map((test) =>
  <tr>
  <td>{test.name}</td>
   <td>{test.questions.length}</td>
   <td>
  <a href="test" class="btn btn-warning">
  <a style={{color:"darkslateblue"}} href={"/edit/"+note.id}>Sta</a>
  </a>
  </td>
  </tr>
);


  return (
    <>
      <div class="container">
        <div class="row">
          <h1>My Interview Portal</h1>
          <hr/>
          <div class="col-md-12">
            <table class="table table-striped">
              <thead>
                <tr>
                  <th>Test</th>
                  <th>No of Questions</th>
                  <th></th>
                </tr>
              </thead>
              <tbody>
                {listItems}
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </>
  );
}

export default Indexinter;
